def rho1562(enc_str):
    
    emo_list = phi8257
    sep = omega8461
    map_idx = xi6345
    parts = enc_str.split(sep)
    out_chars = []
    
    emo_sorted = sorted(emo_list, key=lambda x: len(x), reverse=True)
    for p in parts:
        if not p:
            continue
        idx = 0
        toks = []
        try:
            for _ in range(3):
                matched = False
                for emo in emo_sorted:
                    if p.startswith(emo, idx):
                        toks.append(emo)
                        idx += len(emo)
                        matched = True
                        break
                if not matched:
                    toks = []
                    break
            if len(toks) != 3:
                continue
            a,b,c = toks
            code = map_idx[a]*psi9272*psi9272 + map_idx[b]*psi9272 + map_idx[c]
            out_chars.append(chr(code))
        except Exception:
            continue
    return ''.join(out_chars)

